import React, {useEffect} from 'react'
import axios from "axios";
import {Box, Container} from "@chakra-ui/react";

const Homepage = () => {

    return (
        <Container maxW="xl" centerContent>
            <Box
                d="flex"
                justifyContent="center"
                p={3}
                bg="white"
                w="100%"
                m="40px 0 15px 0"
                borderRadius="lg"
                borderWidth="1px"
            >
                
            </Box>
        </Container>
    )
}
export default Homepage
